import React from 'react';

function HeadlineBookingCompononent() {
	return (
		<div>
			<div class="main">
				<div class="jumbotron jumbotron-fluid bg-dark">
					<div class="container">
						<div class="row align-items-center justify-content-center">
							<p class="text-center text-light slogan-1 lead m-3">
								" The Process For Evolution Is Here... "
							</p>
						</div>
					</div>
				</div>
			</div>
		</div>
	);
}

export default HeadlineBookingCompononent;
